import React, { Component } from 'react';

class Like extends Component {
  handleToggle = () => {
    console.log('toggle activated');
  };

  render() {
    let classes = 'fa fa-heart';
    if (!this.props.liked) classes += '-o';
    return (
      <i
        className={classes}
        aria-hidden="true"
        onToggle={this.handleToggle}
      ></i>
    );
  }
}

export default Like;
